import React, { Component } from "react"
import Nav from './../components/nav';
export default class index extends Component {
  render() {
    return (
      <div>
        <div className="col-lg-4" >
              <div key="1">
                <div className="card mb-3"style={{ maxWidth: 700, marginTop: 20 }}>
                  <div className="row no-gutters">
                    <div className="col-md-12">
                      <div className="card-body text-center" style={{ backgroundColor: "#FFC107" , height: 900 , color:"white"}}>

                      </div>
                    </div>
                  </div>
                </div>
              </div>
          </div>
      </div>
    )
  }
}
